import React from "react";
import "./App.css";

const Home = () => {
  return (
    <div className="home__wrapper">
      <div className="form__wrapper">
        <form action="">
          <input type="text" name="name" id="name" />
          <textarea name="textarea" id="" cols="30" rows="10"></textarea>
        </form>
      </div>
      <Iframe
        src="./Iframe.jsx"
        width="450px"
        height="450px"
        id="idrameId"
        className="iframe"
        display="initial"
        position="relative"
      />
    </div>
  );
};

export default Home;
